import React, { Component } from "react";
import { BrowserRouter } from "react-router-dom";
import Navbar from "./components/navbar/Navbar";

const App = () => {
  return (
    <BrowserRouter>
      <div>
        <Navbar />
      </div>
    </BrowserRouter>
  );
};

export default App;
